import React from 'react';
import Beer from './beer';
import ChristianDrinking from '../../images/team/ChristianDrinking.jpg';

const HeaderSection = () => {
  return(
      <div className="row">
        <div className="col">
        </div>
        <div className="col">
          <img src={ChristianDrinking} height="200px" width="200px"/>
              box-shadow: 0 10px 20px 0 rgba(57,58,61,.15);
        </div>
      </div>
  )
}

export default HeaderSection;
